local texture_list_default = {
    [""] = "",
    ["bizop_santa_8be6e7479f6ee130"] = "",
    ["christmas_snow_boy"] = "",
    ["coronavirus_hazmat_suit_14005506"] = "",
    ["crispy156_mouth"] = "",
    ["crispy156_radioactive_suit"] = "",
    ["levi"] = "",
    ["mtf_epsilon_11_nine_tailed_fox_support_var"] = "",
    ["ninja_9_922e96ac3c6eaf715337081860a63a42bc9"] = "",
    ["reindeer_boy_18324574"] = "",
}
for i, v in pairs(texture_list_default) do
	mcl_skins.register_simple_skin({
        index = n_skins,
		texture = "blank.png^[png:" .. v,
	})
    n_skins = n_skins + 1
end
for i, v in pairs(texture_list_slim) do
    mcl_skins.register_simple_skin({
        index = n_skins,
        texture = "blank.png^[png:" .. v,
        slim_arms = true
    })
    n_skins = n_skins + 1
end
